@WeyandSabine 3/ If there is no Article 218(11) TFEU referral you and @MichelBarnier risk LEGAL CHAOS on 30th March 2019.

The Withdrawal Agreement will be legally challenged.

The EU27 and UK need to agree an Article 50 TEU negotiation period extension now to avoid the legal chaos.

@WeyandSabine 2/

The draft Withdrawal Agreement of 19th March 2018 proposes to remove my EU citizenship.

I suggest (again) that @MichelBarnier refers the draft Withdrawal Agreement to the CJEU using Article 218(11) TFEU
